white = ""
brown = ""
scarlet = ""
purple = ""
cinnabar = ""
garnet = ""
vermillion = ""
sepia = ""
mahogany = ""

nameArray = ["mahogany", "sepia", "vermillion", "garnet", "cinnabar", "purple", "scarlet", "brown", "white"]
geneArray = [mahogany, sepia, vermillion, garnet, cinnabar, purple, scarlet, brown, white]

def compare(str1, str2):
    array1 = []
    array2 = []
    first = 0
    second = 1
    
    for i in range(len(str1)):
        array1.append(str1[first:second])
        first = first + 1
        second = second + 1
    first = 0
    second = 1
    for i in range(len(str2)):
        array2.append(str2[first:second])
        first = first + 1
        second = second + 1
    if len(str1) > len(str2):
        for i in range((len(str1)-len(str2))):
            array2.append("")
    else:
        for i in range((len(str2)-len(str1))):
            array1.append("")
    #print(len(array1))
    #print(len(array2))
    for i in range(len(array1)):
        if array1[i] != array2[i]:
            array1[i] = "-"
    string = ''.join(array1)
    return string

#print(compare(mahogany,vermillion))

def percent(string):
    first = 0
    second = 1
    count = 0
    full = len(string)
    for i in range(len(string)):
        if string[first:second] != "-":
            count += 1
        first += 1
        second += 1
    return count/full * 100

for gene in geneArray:
    indexed = int(geneArray.index(gene) + 1)
    #print(indexed)
    #print(gene)
    for i in range(indexed, len(geneArray)):
        print("" + nameArray[indexed - 1] + " - " + nameArray[i])
        cstr = compare(geneArray[indexed - 1], geneArray[i])
        #print(cstr)
        perc = str(percent(cstr)) + "%"
        print(perc)

while True:
    desiredGene = input("Enter the gene you would like the result for: ")
    ind = nameArray.index(desiredGene)
    dGene = geneArray[ind]

    for gene in geneArray:
        print("" + desiredGene + " - " + nameArray[geneArray.index(gene)])
        cstr = compare(dGene, gene)
        perc = str(percent(cstr)) + "%"
        print(perc)
    

